import React from "react";
import Profile from "../Profile/Profile"
import { Router } from "@reach/router"
import Calendar from "../Calendar/Calendar"

const Content = () => {
  return (
    <div className="page-content-wrapper">
      <div className="page-content" >
      <Router className="router">
              <QuestionAnswer path=":lang/demos/semantic-search" />
              <Ner path=":lang/demos/ner" />
              <Anonymization path=":lang/demos/anonymization" />
              <Nmt path=":lang/demos/nmt" />
              <BodySegmentation path=":lang/demos/segmentation" />
              <SpeakerIdentification path=":lang/demos/speaker-identification" />
              <About path=":lang/demos/" />
            </Router>
      </div>
    
    </div>
  );
};
export default Content;
